import React from 'react';
import "./navbar.css";
import Logo from "../../assets/img/logo-navbar.png"
import { NavLink } from 'react-router-dom';
import Main from "../../pages/main"
const Navbar = () => {
    return (
        <div className="navbar">
            <div className="container">
                <img src={Logo} alt = {""}  className="navbar__logo" ref={<Main/>} />
                <div className="navbar__register"><NavLink to="/registration">  Registration </NavLink> </div>
                <div className="navbar__login"><NavLink to="/login">  Login </NavLink> </div>
            </div>
        </div>
    );
};

export default Navbar;
